import React, { useState } from 'react';
import AddVehicleForm from '../pages/AddVehicleForm';

function VehicleListPage() {
  const [vehicles, setVehicles] = useState([]);

  const handleAddVehicle = (newVehicle) => {
    setVehicles([...vehicles, { ...newVehicle, id: Date.now() }]);
  };

  return (
    <div className="vehicle-list-page">
      <h1>Vehicle Management</h1>
      <AddVehicleForm onAddVehicle={handleAddVehicle} />
      <table className="vehicle-table">
        <thead>
          <tr>
            <th>Name</th>
            <th>Model</th>
            <th>Year</th>
            <th>License Plate</th>
            <th>VIN</th>
          </tr>
        </thead>
        <tbody>
          {vehicles.map(vehicle => (
            <tr key={vehicle.id}>
              <td>{vehicle.name}</td>
              <td>{vehicle.model}</td>
              <td>{vehicle.year}</td>
              <td>{vehicle.licensePlate}</td>
              <td>{vehicle.vin}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default VehicleListPage;
